import AddCoin from "./AddCoin";
import Home from "./Home";
import Navbar from "./Navbar";
import { BrowserRouter, Routes, Route } from "react-router-dom";

const Main = () => {
  return (
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Route>
          <Route index element={<Home />} />
          <Route path="addcoin" element={<AddCoin />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
};

export default Main;
